import React, { Component } from 'react'

class People extends Component {
    render() {
        return (
            < React.Fragment >
                {
                    this.props.datos.map(persona => {
                        return (
                            <div className="card">
                                <img src={persona.photo} className="card-img-top" alt="..." />
                                <div className="card-body">
                                    <h5 className="card-title">{persona.name}</h5>
                                    <p className="card-text"><span>{persona.name}</span>{persona.surname}</p>
                                    <p className="card-text"><span>Gender: </span>{persona.gender}</p>
                                    <p className="card-text"><span>Gender: </span>{persona.gender}</p>
                                    <p className="card-text"><span>Region: </span>{persona.region}</p>

                                </div>
                            </div>)
                    })
                }
            </React.Fragment >
        )
    }
}

export default People
